 Janusz Kacprzyk, Witold Pedrycz, &quot;Handbook of Computational Intelligence&quot;

2015 | ISBN-10: 3662435047 | 1634 pages | PDF | 65 MB

The Handbook for Computational Intelligence is the first book covering the basics, the state-of-the-art and important applications of the dynamic and rapidly expanding discipline of computational intelligence. This comprehensive handbook makes readers familiar with a broad spectrum of approaches to solve various problems in science and technology. Possible approaches include, for example, those being inspired by biology, living organisms and animate systems. Content is organized in seven parts: foundations; fuzzy logic; rough sets; evolutionary computation; neural networks; swarm intelligence and hybrid computational intelligence systems. Each Part is supervised by its own Part Editor(s) so that high-quality content as well as completeness are assured
